global:
  exec: 'accelerate launch --num_processes NUM_PROC --main_process_port PORT --config_file ./accelerator_config.yaml main.py'
  params: 
    batch_size: 512
    update_freq: 1
    num_attn_layer: 2
    ee_dim: 512 
    lr: 6.25e-4
    epochs: 10
    warmup_epochs: 1
    weight_decay: 0.05
    mixup: 0.8
    cutmix: 1.0
    use_amp: True
    model_ema: True
    data_set: IMNET
    num_workers: 20
    prefetch_factor: 2
    eval_interval: 0
    gpuaug: True
    dataloader: multiepoch
    data_path: /ssd_storage/public/imagenet
    output_dir: ./training/
    record_dir: ./records/
    job_index: search_10ep
    force_refresh: False

